DROP TABLE IF EXISTS `sys_dept`;
CREATE TABLE `sys_dept` (
  `id` varchar(64) NOT NULL COMMENT '编号',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '名称',
  `short_name` varchar(255) DEFAULT NULL COMMENT '简称',
  `parent_id` varchar(64) NOT NULL COMMENT '父级编号',
  `level` char(2) CHARACTER SET utf8 COLLATE utf8_bin NOT NULL COMMENT '集团              1\r\n  |-集团领导      2\r\n  |-处室          3\r\n  |  |-处领导     4\r\n  |  |-处科室     5\r\n  |-段            6\r\n    |-段领导      7\r\n    |-段科室      8\r\n    |-车间        9\r\n      |-工区      10',
  `kind` char(1) NOT NULL COMMENT '机构类型',
  `classid` varchar(255) DEFAULT NULL COMMENT '部门分类',
  `phone` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `sort` decimal(10,0) NOT NULL COMMENT '排序',
  `status` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '是否启用',
  `del_flag` char(1) NOT NULL DEFAULT '0' COMMENT '删除标记',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `create_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `sys_office_parent_id` (`parent_id`) USING BTREE,
  KEY `sys_office_del_flag` (`del_flag`) USING BTREE,
  KEY `sys_office_type` (`kind`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='机构表';

