-- ----------------------------
-- Table structure for `sys_message`
-- ----------------------------
DROP TABLE IF EXISTS `sys_message`;
CREATE TABLE `sys_message` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '编号',
  `system` varchar(64) NOT NULL COMMENT '系统标识',
  `opr_table` varchar(64) NOT NULL COMMENT '操作表',
  `message` varchar(4000) DEFAULT NULL COMMENT '发送消息',
  `type` varchar(20) DEFAULT NULL COMMENT '同步类型',
  `syn_status` varchar(20) DEFAULT NULL COMMENT '同步状态',
  `err_cause` varchar(4000) DEFAULT NULL COMMENT '失败原因',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_time` datetime DEFAULT NULL COMMENT '同步时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='同步消息表';

-- ----------------------------
-- Records of sys_message
