-- ----------------------------
-- Table structure for `sys_station`
-- ----------------------------
DROP TABLE IF EXISTS `sys_station`;
CREATE TABLE `sys_station` (
  `id` varchar(64) NOT NULL COMMENT '车站主键',
  `station_number` varchar(100) DEFAULT NULL COMMENT '车站略号',
  `name` varchar(100) DEFAULT NULL COMMENT '车站名称',
  `short_name` varchar(100) DEFAULT NULL COMMENT '车站简称',
  `line_id` varchar(64) DEFAULT NULL COMMENT '一级归属线别主键',
  `station_class` varchar(100) DEFAULT NULL COMMENT '车站类别(字典)区段站 中间站 其他',
  `flag` bigint(64) DEFAULT NULL COMMENT ' 1-大站 其它-小站',
  `type` bigint(64) DEFAULT NULL COMMENT '1是车站，2是驼峰，3是道口，4是区间 [N_TYPE]',
  `up_mark` double(100,0) DEFAULT NULL COMMENT '上行公里标',
  `down_mark` double(100,0) DEFAULT NULL COMMENT '下行公里标',
  `phone` varchar(100) DEFAULT NULL COMMENT '值班电话',
  `build` varchar(100) DEFAULT NULL COMMENT '建设年',
  `repair_h` varchar(100) DEFAULT NULL COMMENT '大修年',
  `repair_m` varchar(100) DEFAULT NULL COMMENT '中修年',
  `interlock_type` varchar(100) DEFAULT NULL COMMENT '联锁类型(字典)',
  `interlock_work` varchar(255) DEFAULT NULL COMMENT '联锁厂家',
  `computer_type` varchar(100) DEFAULT NULL COMMENT '计算机联锁类型',
  `block_mode` varchar(100) DEFAULT NULL COMMENT '闭塞方式(字典)',
  `trackcuit_type` varchar(100) DEFAULT NULL COMMENT '轨道电路类型(字典)',
  `code_mode` varchar(100) DEFAULT NULL COMMENT '电码化方式(字典)',
  `code_type` varchar(100) DEFAULT NULL COMMENT '电码化类型(字典)',
  `rightrail_type` varchar(100) DEFAULT NULL COMMENT '正线钢轨类型(字典)',
  `siderail_type` varchar(100) DEFAULT NULL COMMENT '侧线钢轨类型(字典)',
  `if_eds` varchar(100) DEFAULT NULL COMMENT '是否安装微机检测 ',
  `sup_mode` varchar(100) DEFAULT NULL COMMENT ' 监控方式(字典',
  `switch_for_equ` bigint(64) DEFAULT NULL COMMENT '设备换算道岔数 ',
  `block_type` varchar(100) DEFAULT NULL COMMENT '闭塞显示类型(字典) ',
  `power_type` varchar(100) DEFAULT NULL COMMENT '电源屏类型',
  `power_work` varchar(100) DEFAULT NULL COMMENT '电源屏厂家 ',
  `power_equ` varchar(100) DEFAULT NULL COMMENT ' 电源屏类型设备',
  `sl_relation_id` varchar(100) DEFAULT NULL COMMENT '车站和线路的对应关系主键 ',
  `sort` bigint(64) DEFAULT NULL COMMENT '树排序用的序号',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标识 ',
  `remark` varchar(500) DEFAULT NULL COMMENT '车站描述',
  `create_by` varchar(64) DEFAULT '' COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT '' COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='车站管理';

-- ----------------------------
-- Records of sys_station
-- ----------------------------

-- ----------------------------
-- Table structure for `sys_user`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user`;
CREATE TABLE `sys_user` (
  `user_id` varchar(64) NOT NULL COMMENT '编号',
  `dept_id` varchar(64) DEFAULT NULL COMMENT '归属部门',
  `login_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '登录名',
  `user_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '姓名',
  `password` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '密码',
  `no` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '工号',
  `is_common` int(5) DEFAULT '0' COMMENT '是否公共邮箱',
  `wage_number` varchar(64) DEFAULT NULL COMMENT '工资号',
  `idcard` varchar(64) DEFAULT '' COMMENT '身份证号',
  `sex` varchar(10) DEFAULT '0' COMMENT '性别',
  `sort` int(11) DEFAULT '0' COMMENT '排序',
  `email` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `phone` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '电话',
  `phonenumber` varchar(200) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '手机',
  `login_ip` varchar(100) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '最后登陆IP',
  `login_date` datetime DEFAULT NULL COMMENT '最后登陆时间',
  `avatar` varchar(1000) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '用户头像',
  `status` varchar(64) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '是否可登录',
  `del_flag` char(1) DEFAULT '0' COMMENT '删除标记',
  `remark` varchar(255) CHARACTER SET utf8 COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `create_by` varchar(64) DEFAULT NULL COMMENT '创建者',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) DEFAULT NULL COMMENT '更新者',
  `update_time` datetime DEFAULT NULL COMMENT '更新时间',
  PRIMARY KEY (`user_id`) USING BTREE,
  KEY `sys_user_office_id` (`dept_id`) USING BTREE,
  KEY `sys_user_login_name` (`login_name`) USING BTREE,
  KEY `sys_user_update_date` (`update_time`) USING BTREE,
  KEY `sys_user_del_flag` (`del_flag`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='用户表';

-- ----------------------------
-- Records of sys_user
-- ----------------------------

-- ----------------------------
-- Table structure for `sys_user_online`
-- ----------------------------
DROP TABLE IF EXISTS `sys_user_online`;
CREATE TABLE `sys_user_online` (
  `sessionId` varchar(50) NOT NULL DEFAULT '' COMMENT '用户会话id',
  `login_name` varchar(50) DEFAULT '' COMMENT '登录账号',
  `dept_name` varchar(50) DEFAULT '' COMMENT '部门名称',
  `ipaddr` varchar(50) DEFAULT '' COMMENT '登录IP地址',
  `login_location` varchar(255) DEFAULT '' COMMENT '登录地点',
  `browser` varchar(50) DEFAULT '' COMMENT '浏览器类型',
  `os` varchar(50) DEFAULT '' COMMENT '操作系统',
  `status` varchar(10) DEFAULT '' COMMENT '在线状态on_line在线off_line离线',
  `start_timestamp` datetime DEFAULT NULL COMMENT 'session创建时间',
  `last_access_time` datetime DEFAULT NULL COMMENT 'session最后访问时间',
  `expire_time` int(5) DEFAULT '0' COMMENT '超时时间，单位为分钟',
  PRIMARY KEY (`sessionId`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='在线用户记录';

-- ----------------------------
-- Records of sys_user_online
-- ----------------------------

